import * as React from 'react';
import {
  Grid,
  Typography,
  Paper,
  Input,
  FormControl,
  FormLabel,
  RadioGroup,
  Radio,
  FormControlLabel,
} from '@material-ui/core';
import useTranslations from '../../hooks/useTranslations';
import useStyles from './style';

const CreateNewUser = () => {
  const { t } = useTranslations();
  const classes = useStyles();
  return (
    <Paper className={classes.contentContainer}>
      <Grid container spacing={4}>
        <Grid item xs={12} sm={6}>
          <Input
            className={classes.input}
            placeholder={t('register-first-name')}
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <Input className={classes.input} placeholder={t('register-name')} />
        </Grid>
      </Grid>
      <Grid container spacing={4}>
        <Grid item xs={12} sm={6}>
          <Input
            className={classes.input}
            type="email"
            placeholder={t('register-email')}
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <Input className={classes.input} placeholder={t('register-phone')} />
        </Grid>
      </Grid>
    </Paper>
  );
};

const RegisterVisit: React.FunctionComponent = () => {
  const classes = useStyles();
  const { t } = useTranslations();
  return (
    <div className={classes.root}>
      <Grid container spacing={4}>
        <Grid item xs={12} sm={6}>
          <Typography variant="body1">{t('administration')}</Typography>
          <Typography variant="h6">{t('visitor-register')}</Typography>
        </Grid>
      </Grid>
      <Grid container spacing={4}>
        <Grid item xs={12} sm={6}>
          <FormControl component="fieldset">
            <FormLabel component="legend">Benutzertype</FormLabel>
            <RadioGroup row name="visitorType" value="" onChange={() => {}}>
              <FormControlLabel
                value="new"
                control={<Radio />}
                label="Neuer Besucher"
                labelPlacement="start"
              />
              <FormControlLabel
                value="registered"
                control={<Radio />}
                label="Bereits regisitriert"
                labelPlacement="end"
              />
            </RadioGroup>
          </FormControl>
        </Grid>
        <CreateNewUser />
      </Grid>
    </div>
  );
};

export default RegisterVisit;
